    var query_details = {
        filters: {"Gender": "", "RaceEthnicity": "", "Loss": ""},
        outputCol: "",
        category: ""
    }

    function queryDetails() {
        alert(selectedLevel);
    }

    return (
        <button className = "buttonShadow" onClick={queryDetails}>Get Data!</button>
    ); 
}

export default Button
